import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
 display: flex;
 flex-direction : column;
`


const Home = () => {
    return (
        <Container>
            <LogoSection>
                <img 
                src="https://www.google.com/images/branding/googlelogo/1x/googlelogo_color_272x92dp.png"
                alt="logo_google"/>
            </LogoSection>
        </Container>
    )
}

export default Home
